import React from "react"
import Button from "./Button"

class ButtonContainer extends React.Component{
    constructor(props){
        super(props)
        this.actions = props.actions;
    }

    render(){
        return(
            <div id="button-container">
                <Button functionName="mask" />
                <Button functionName="spider"/>
                <Button functionName="camera"/>
                <Button functionName="kiwi"/>
                <Button functionName="lemon"/>
                <Button functionName="death"/>
                <Button functionName="d20"/>
            </div>
        )
    }
}

export default ButtonContainer
